INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (19656, 3156, 'Progesterone', 'Thyroid Diseases', 'When administering estrogen and/or progestogen therapy in patients with thyroid disorders, clinicians should be aware that these hormones may affect thyroid function tests.  Changes have mostly been reported with the use of combination oral contraceptives.  Specifically, thyroid-binding globulin (TBG) may be increased, resulting in elevated circulating total thyroid hormone, as measured by PBI (protein-bound iodine), T4 by column or radioimmunoassay, or T3 by radioimmunoassay.  Free T3 resin uptake may be decreased.  On the contrary, a decrease in TBG and, consequently, thyroxine concentration, has been reported by the manufacturers of the progestin-only (norethindrone) oral contraceptives.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (19657, 3208, 'Progesterone', 'Thyroid Diseases', 'When administering estrogen and/or progestogen therapy in patients with thyroid disorders, clinicians should be aware that these hormones may affect thyroid function tests.  Changes have mostly been reported with the use of combination oral contraceptives.  Specifically, thyroid-binding globulin (TBG) may be increased, resulting in elevated circulating total thyroid hormone, as measured by PBI (protein-bound iodine), T4 by column or radioimmunoassay, or T3 by radioimmunoassay.  Free T3 resin uptake may be decreased.  On the contrary, a decrease in TBG and, consequently, thyroxine concentration, has been reported by the manufacturers of the progestin-only (norethindrone) oral contraceptives.', '2', '', 'DDInter', 0);
