INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (19676, 3156, 'Progesterone', 'Hyperlipidemias', 'Some progestogenic agents may elevate plasma LDL levels and/or lower HDL levels, although data have been inconsistent.  Patients with preexisting hyperlipidemia may require closer monitoring during progestogen therapy, and adjustments made accordingly in their lipid-lowering regimen.', '2', '', 'DDInter', 0);
